import React from 'react';
import styled from 'styled-components';
import Navigation from './Navigation';
const GridWrapper = styled.div`
  display: grid;
  grid-gap: 10px;
  margin-top: 1em;
  margin-left: 6em;
  margin-right: 6em;
  grid-template-columns: repeat(12, 1fr);
  grid-auto-rows: minmax(25px, auto);
   
`;
 const Home = (props) => (
  <GridWrapper>
      
    
  </GridWrapper>
)

export default Home
